import React from 'react';
import AppBar from '@mui/material/AppBar';
import { Tab, Tabs, Toolbar, Typography } from '@mui/material';
import './navBar.css';

function NavBar(){
    return(
        <React.Fragment>
            <AppBar className = "custom-app-bar">
                <Toolbar>
                    <Typography>Renold Engineering</Typography>
                    <Tabs className='app-bar-tabs'>
                        <Tab label='Home'/>
                        <Tab label='Products'/>
                        <Tab label='About'/>
                        <Tab label='Contact Us'/>
                    </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}

export default NavBar;
